function runEngine(){try{engine()}catch(n){console.error(n)}}function engine(){var n=Array.from(document.getElementsByClassName("schoolSubjectItem"));n.forEach(n=>n.addEventListener("click",searchSchoolSubject))}function searchSchoolSubject(n){let t=n.currentTarget.id;window.location.href=`/Teachers/All?subjectId=${t}`}document.addEventListener("load",runEngine);